import React from 'react';
import { gql } from 'apollo-boost';

const getBooksQuery = gql`
    {
        books{
            name
        }
    }
`

function BookList() {
    return (
        <div className="book__lists">
            <ol className="book-list">
                <li>Book Name</li>
            </ol>
        </div>
    )
}

export default BookList
